                            <div className="portfolio-card-description">Lorem ipsum dolor sit amet.</div>
                            <div className="portfolio-card-link">Link</div>
                        </div>
                    </div>
                    <div className="portfolio-right col-sm">
                        <h1>Article Title</h1>
                    </div>
            </div>
        );
    }
}

ReactDOM.render(<Portfolio />, document.getElementById('root'));
export default Portfolio;
